import React from "react";

export const Login = () => {
    return <div>
        <h1>LOGIN</h1>
        <LoginForm/>
    </div>
}

type LoginFormType = {}
const LoginForm: React.FC<LoginFormType> = () => {
    return <form>
        <input type="text"/>
        <input type="password"/>
        <input type="checkbox"/>
    </form>
}
